css:
@-moz-document url(https://www.kenmei.co/dashboard) {
  nav.relative.z-10.bg-white.shadow.dark_bg-gray-900{
  	background-color: black;
  }

  .top-drawer{
  	background-color: rgb(35 35 35)!important;
    border-color: rgb(35 35 35)!important;
  }

  .h-screen .flex.flex-col.items-center{
  	background-color: rgb(35 35 35)!important;
  }
  
  .the-dashboard.mt-4{
    background-color: rgb(35 35 35)!important;
  }

  p.text-sm.leading-5.text-gray-700.dark_text-white{
  	color: white!important;
  }

  a.series-link{
  	color: white!important;
  }

  a.list-row.group.list-row__regular:hover{
    background-color: black!important;
  }
  
  li.transition.duration-150.ease-in-out:hover{
    background-color: dimgray!important;
  }
  
  .min-h-full.flex.flex-col.bg-gray-50.dark_bg-slate-700{
    background-color: rgb(35 35 35)!important;
  }
  
  footer.shrink-0{
    background-color: rgb(35 35 35)!important;
    border-color: rgb(35 35 35)!important;
  }
}
